function showInfo(event, nombre) {
    // Ocultar cualquier tooltip existente
    hideAllTooltips();

    let info = findDioceseInfo(diocesisData, nombre);
    if (info) {
        // Obtener el elemento SVG raíz
        let svg = document.querySelector('svg');

        // Crear grupo para el tooltip
        let tooltip = document.createElementNS("http://www.w3.org/2000/svg", "g");
        tooltip.setAttribute("class", "diocese-info");

        // Crear rectángulo de fondo
        let rect = document.createElementNS("http://www.w3.org/2000/svg", "rect");
        rect.setAttribute("fill", "white");
        rect.setAttribute("stroke", "#ccc");
        rect.setAttribute("rx", "5");
        rect.setAttribute("ry", "5");

        // Crear textos
        let title = document.createElementNS("http://www.w3.org/2000/svg", "text");
        title.setAttribute("class", "tooltip-text");
        title.setAttribute("x", "10");
        title.setAttribute("y", "20");
        title.textContent = info.nombre;

        let link = document.createElementNS("http://www.w3.org/2000/svg", "a");
        link.setAttributeNS("http://www.w3.org/1999/xlink", "xlink:href", info.url);
        link.setAttribute("target", "_blank");

        let linkText = document.createElementNS("http://www.w3.org/2000/svg", "text");
        linkText.setAttribute("class", "tooltip-text");
        linkText.setAttribute("x", "10");
        linkText.setAttribute("y", "40");
        linkText.textContent = "Ver más información";

        link.appendChild(linkText);

        // Calcular dimensiones del tooltip
        let bbox = title.getBBox();
        let width = Math.max(bbox.width, 150) + 20;
        let height = 60;

        // Posicionar tooltip cerca del cursor
        let pt = svg.createSVGPoint();
        pt.x = event.clientX;
        pt.y = event.clientY;
        let svgP = pt.matrixTransform(svg.getScreenCTM().inverse());

        rect.setAttribute("width", width);
        rect.setAttribute("height", height);
        rect.setAttribute("x", svgP.x + 10);
        rect.setAttribute("y", svgP.y + 10);

        title.setAttribute("x", svgP.x + 20);
        title.setAttribute("y", svgP.y + 30);
        linkText.setAttribute("x", svgP.x + 20);
        linkText.setAttribute("y", svgP.y + 50);

        tooltip.appendChild(rect);
        tooltip.appendChild(title);
        tooltip.appendChild(link);

        svg.appendChild(tooltip);
        tooltip.style.display = "block";
    }
}

function hideAllTooltips() {
    let tooltips = document.getElementsByClassName('diocese-info');
    Array.from(tooltips).forEach(tooltip => {
        tooltip.remove();
    });
}

function findDioceseInfo(data, nombre) {
    // Limpiar el nombre de cualquier sufijo (x3, x4, etc.)
    let cleanNombre = nombre.replace(/\s+x\d+$/, '');

    // Buscar en archidiócesis
    for (let arch of data.archidiocesis) {
        if (arch.nombre.toLowerCase() === cleanNombre.toLowerCase()) {
            return arch;
        }
        // Buscar en diócesis
        for (let diocese of arch.diocesis) {
            if (diocese.nombre.toLowerCase() === cleanNombre.toLowerCase()) {
                return diocese;
            }
        }
    }
    return null;
}

// Cerrar tooltip al hacer click fuera
document.addEventListener('click', function(event) {
    if (!event.target.closest('.clickable')) {
        hideAllTooltips();
    }
});
